import React, { useEffect, useState, useRef } from "react";
import "../style/login.css";
import { Link } from "react-router-dom";
import axios from "axios";

const Signup = () => {
  let [current, setCurrent] = useState(0);
  const [user, setUser] = useState({});

  const fetchAxios = async () => {
    const data = await axios.post("http://localhost:3001/users", user);
    console.log(data);
  };

  // useEffect(() => {
  //   fetchAxios();
  // }, []);

  const slidePage = useRef(null);
  const bulletRefs = useRef([]);
  const progressCheckRefs = useRef([]);
  const progressTextRefs = useRef([]);

  const handleNext = (margin) => {
    slidePage.current.style.marginLeft = margin;
    if (current >= 1 && current <= bulletRefs.current.length) {
      bulletRefs.current[current - 1].classNameList.add("active");
      progressCheckRefs.current[current - 1].classNameList.add("active");
      progressTextRefs.current[current - 1].classNameList.add("active");
      setCurrent(current + 1);
    } else {
      console.log("Invalid current value:", current);
    }
  };

  const handleSubmit = () => {
    if (current >= 1 && current <= bulletRefs.current.length) {
      bulletRefs.current[current - 1].classNameList.add("active");
      progressCheckRefs.current[current - 1].classNameList.add("active");
      progressTextRefs.current[current - 1].classNameList.add("active");
      setCurrent(current + 1);

      // const token = localStorage.setItem("token",token);

      setTimeout(function () {
        alert("Your Form Successfully Signed up");
      }, 800);
    } else {
      console.log("Invalid current value:", current);
    }
  };

  const handlePrev = (margin) => {
    slidePage.current.style.marginLeft = margin;
    if (current >= 1 && current <= bulletRefs.current.length) {
      bulletRefs.current[current - 2].classNameList.add("active");
      progressCheckRefs.current[current - 2].classNameList.add("active");
      progressTextRefs.current[current - 2].classNameList.add("active");
      setCurrent(current - 1);
    } else {
      console.log("Invalid current value:", current);
    }
  };

  return (
    <div className="container">
      <header>Signup Form</header>
      <div className="progress-bar">
        <div className="step">
          <p ref={progressTextRefs}>Name</p>
          <div ref={bulletRefs} className="bullet">
            <span>1</span>
          </div>
          <div ref={progressCheckRefs} className="check fas fa-check"></div>
        </div>
        <div className="step">
          <p ref={progressTextRefs}>Contact</p>
          <div ref={bulletRefs} className="bullet">
            <span>2</span>
          </div>
          <div ref={progressCheckRefs} className="check fas fa-check"></div>
        </div>
        <div className="step">
          <p ref={progressTextRefs}>Birth</p>
          <div ref={bulletRefs} className="bullet">
            <span>3</span>
          </div>
          <div ref={progressCheckRefs} className="check fas fa-check"></div>
        </div>
        <div className="step">
          <p ref={progressTextRefs}>Submit</p>
          <div ref={bulletRefs} className="bullet">
            <span>4</span>
          </div>
          <div ref={progressCheckRefs} className="check fas fa-check"></div>
        </div>
      </div>
      <div className="form-outer">
        <form action="#">
          <div ref={slidePage} className="page slide-page">
            <div className="title">Basic Info:</div>
            <div className="field">
              <div className="label">First Name</div>
              <input onChange={(e) => setUser(e.target.value)} type="text" />
            </div>
            <div className="field">
              <div className="label">Last Name</div>
              <input onChange={(e) => setUser(e.target.value)} type="text" />
            </div>
            <div className="field">
              <button
                onClick={() => handleNext("-25%")}
                className="firstNext next"
              >
                Next
              </button>
            </div>
          </div>
          <div className="page">
            <div className="title">Contact Info:</div>
            <div className="field">
              <div className="label">Email Address</div>
              <input onChange={(e) => setUser(e.target.value)} type="text" />
            </div>
            <div className="field">
              <div className="label">Phone Number</div>
              <input onChange={(e) => setUser(e.target.value)} type="Number" />
            </div>
            <div className="field btns">
              <button onClick={() => handlePrev("0%")} className="prev-1 prev">
                Previous
              </button>
              <button
                onClick={() => handleNext("-50%")}
                className="next-1 next"
              >
                Next
              </button>
            </div>
          </div>
          <div className="page">
            <div className="title">Date of Birth:</div>
            <div className="field">
              <div className="label">Date</div>
              <input onChange={(e) => setUser(e.target.value)} type="text" />
            </div>
            <div className="field">
              <div className="label">Gender</div>
              <select>
                <option>Male</option>
                <option>Female</option>
                <option>Other</option>
              </select>
            </div>
            <div className="field btns">
              <button
                onClick={() => handlePrev("-25%")}
                className="prev-2 prev"
              >
                Previous
              </button>
              <button
                onClick={() => handleNext("-75%")}
                className="next-2 next"
              >
                Next
              </button>
            </div>
          </div>
          <div className="page">
            <div className="title">Login Details:</div>
            <div className="field">
              <div className="label">Username</div>
              <input onChange={(e) => setUser(e.target.value)} type="text" />
            </div>
            <div className="field">
              <div className="label">Password</div>
              <input
                onChange={(e) => setUser(e.target.value)}
                type="password"
              />
            </div>
            <div className="field btns">
              <button
                onClick={() => handlePrev("-50%")}
                className="prev-3 prev"
              >
                Previous
              </button>
              <button onClick={handleSubmit} className="submit">
                Submit
              </button>
            </div>
          </div>
        </form>
        <div>
          already have an acount? <Link to="/login">Login</Link>
        </div>
      </div>
    </div>
  );
};
export default Signup;
